  `,tags:[{name:"certification skills measured",link:"https://query.prod.cms.rt.microsoft.com/cms/api/am/binary/RE4tnJr",color:"cyan-text-gradient"}],images:VQ,source_code_link2:"certifications/Networking Fundamentals.pdf"},{name:"MTA: Windows Operating System Fundamentals",description:`
